import React, { Component } from "react";
import axios from "axios";
import { Container, Form, Button, col } from "react-bootstrap";

export class CreateRequest extends Component {
  constructor(props) {
    super();
    this.state = {
      title: "",
      description: "",
    };
    this.onChangeTitle = this.onChangeTitle.bind(this);
    this.onChangeDescription = this.onChangeDescription.bind(this);

    this.handleSubmit = this.handleSubmit.bind(this);

  }

  onChangeTitle(currObj) {
    console.log(currObj.target.value);
    this.setState({ title: currObj.target.value });
  }

  onChangeDescription(currObj) {
    console.log(currObj.target.value);
    this.setState({ description: currObj.target.value });
  }
  

  handleSubmit(e) {
    e.preventDefault();

    console.log("## " + this.state.title)
    const userPostRequest = {
      title: this.state.title,
      description: this.state.description,
    };
    console.log("TEST:" + JSON.stringify(userPostRequest));

    axios
      .post("http://localhost:5000/createRequest", userPostRequest)
      .then((res) => console.log("****" + res.data));
    this.setState({
      title: "",
      description: "",
    });
  }

  render() {
    return (
      <div>
        <h1>Post Request</h1>
        <div className="col-4">
          <Container>
            <Form onSubmit={this.handleSubmit}>
              <Form.Group>
                <Form.Label>Title:</Form.Label>
                {/* <Form.Control type="text" onChange={(e) => setTitle(e.target.value)}  value={title}/> */}

                <Form.Control
                  type="title"
                  value={this.state.title}
                  onChange={this.onChangeTitle}
                />
              </Form.Group>
              <Form.Group>
                <Form.Label>Description:</Form.Label>
            

                <Form.Control
                  type="description"
                  value={this.state.description}
                  onChange={this.onChangeDescription}
                />
              </Form.Group>


              <Form.Group className="formInput">
              <Form.Label>Select Category</Form.Label>
              <Form.Select>
                <option value="1">Electrician</option>
                <option value="2">Plumber</option>
                <option value="3">Carpenter</option>
                <option value="4">Hairs Stylist and Barbers</option>
                <option value="5">Beautician</option>
                <option value="6">Bakers</option>
                <option value="7">Nail Technician</option>
                <option value="8">Painter</option>
                <option value="9">Chef</option>
                <option value="10">Cleaner</option>
              </Form.Select>
            </Form.Group>
            <Form.Group>
              <Form.Label as="legend" className="formInput" />
              <Col sm="{10}">
                <Form.Check
                  inline
                  type="radio"
                  label="Free"
                  name="cost"
                  id="freeId"
                />
                <Form.Check
                  inline
                  type="radio"
                  label="Please Contact"
                  name="cost"
                  id="pleaseContact"
                />
                <Form.Check
                  inline
                  type="radio"
                  name="cost"
                  label="Price"
                  id="price"
                />
              </Col>
            </Form.Group>
            <Form.Group>
              <Form.Label as="legend">Select date:</Form.Label>
            </Form.Group>
            <Form.Group className="">
              <Form.Label as="legend">Start date</Form.Label>
              <Form.Control type="date" />
              <Form.Label as="legend">End date</Form.Label>
              <Form.Control type="date" />
            </Form.Group>
            <Form.Group className="">
              <Form.Label>Add Location:</Form.Label>
              <Form.Control type="text" />
            </Form.Group> 
              <Button type="submit">Submit</Button>
              
            </Form>
          </Container>
        </div>
      </div>
    );
  }
}
